import { Box, Button, Paper, Typography } from "@material-ui/core";
import { height } from "@mui/system";
import Exitpage from './Exitpage';

import React from "react";
import { useSelector } from "react-redux";
function slot(propsData) {
  const parkingList = useSelector((state) => state);
  console.log(parkingList,"parkingList")
  return (
    <Paper
      style={{
        padding: 16,
        color: "#e8t6e9",
        background: "",
        margin: "4px",
        textAlign:"center",
        width:"300px",
        height:"300px"
      }}
      variant="outlined"
    >
      <Typography
        variant="h5"
        align="center"
        component="h1"
        style={{ padding: 16 }}
      >
      </Typography>

         <>

      <Typography
        variant="h6"
        align="center"
        component="h1"
        style={{ padding: 16 }}
      >
        Vehicle Number: 62642476
      </Typography>
      <Typography
        variant="h6"
        align="center"
        component="h1"
        style={{ padding: 16 }}
      >
        Entry Time : 09:00 Am
      </Typography>
      <Typography
        variant="h6"
        align="center"
        component="h1"
        style={{ padding: 16 }}
      >
        Exit Time : 11:20 Am
      </Typography>
      <Exitpage/>
      {/* <Button
        variant="contained"
        color="primary"
        type="submit"
        //   disabled={submitting}
      >

      </Button> */}
         </>

      {
         !propsData.booked &&

         <Typography
        variant="h6"
        align="center"
        component="h1"
        style={{ padding: 16 }}
      >
        Available
      </Typography>

      }

    </Paper>
  );
}

export default slot;
